  <script type="text/x-mathjax-config">
    MathJax.Hub.Config({
      CommonHTML: { linebreaks: { automatic: true } },
      "HTML-CSS": { linebreaks: { automatic: true } },
           SVG: { linebreaks: { automatic: true } }
    });
    window.addEventListener('resize', MJrerender);

    let t = -1;
    let delay = 1000;
    function MJrerender() {
      if (t >= 0) {
        // If we are still waiting, then the user is still resizing =>
        // postpone the action further!
        window.clearTimeout(t);
      }
      t = window.setTimeout(function() {
        MathJax.Hub.Queue(["Rerender",MathJax.Hub]);
        t = -1; // Reset the handle
      }, delay);
    };
  </script>
  <script type="text/javascript">
    function toggle (elements) {
      var element, index, none_hidden;

      elements = elements.length ? elements : [elements];
      none_hidden = true;
      for (index = 0; index < elements.length; index++) {
        element = elements[index];
        if (isElementHidden(element)) {
          none_hidden = false;
        }
      }

      if (none_hidden) {
        for (index = 0; index < elements.length; index++) {
          element = elements[index];
          element.style.display = 'none';
        }
      } else {
        for (index = 0; index < elements.length; index++) {
          element = elements[index];
          element.style.display = 'block';
        }
      }

      function isElementHidden (element) {
        return window.getComputedStyle(element, null).getPropertyValue('display') === 'none';
      }
    }

    function show_class (name) {
      var elements = document.getElementsByClassName(name);
      toggle(elements);
    }

    function show_single (id) {
      var element = document.getElementById(id);
      toggle(element);
    }

    function unfold_one (id) {
      var elements = document.getElementById('unfold'+id);
      var buttons = document.getElementById('unfold_button'+id);
      var element, button, index, none_hidden;

      elements = elements.length ? elements : [elements];
      none_hidden = true;
      for (index = 0; index < elements.length; index++) {
        element = elements[index];
        if (isElementHidden(element)) {
          none_hidden = false;
        }
      }

      if (none_hidden) {
        for (index = 0; index < elements.length; index++) {
          element = elements[index];
          element.style.display = 'none';
          buttons.innerHTML = '&#9657;';
        }
      } else {
        for (index = 0; index < elements.length; index++) {
          element = elements[index];
          element.style.display = 'block';
          buttons.innerHTML = '&#9663;';
        }
      }

      function isElementHidden (element) {
        return window.getComputedStyle(element, null).getPropertyValue('display') === 'none';
      }
    }
  </script>
